### What happened?

production.ERROR: Illuminate\Database\Grammar::parameterize(): Argument #1 ($values) must be of type array, string given.

In this function:

```php
public function logMailEvent($payload): void
    {
        $mail = $this->getMailFromPayload($payload);

        if (is_null($mail)) {
            return;
        }

        $data = $this->getDataFromPayload($payload);
        $method = Str::camel($data['type']);

        if (method_exists($this, $method)) {
            // log mail event
            $mail->events()->create($data); // Here

            // update mail record with timestamp
            $this->{$method}($mail, $this->getTimestampFromPayload($payload));
        }
    }
```

### How to reproduce the bug

Testing webhooks from Mailgun

